function func2(str, pos) {
  if (str.charAt(pos) === "#") {
    return 1;
  } else {
    return 0;
  }
}

function func1(xmove, ymove, _col, _pos, _cnt, _l) {
  while(true) {
    var l = _l;
    var cnt = _cnt;
    var pos = _pos;
    var col = _col;
    if (!l) {
      return cnt;
    }
    var rest = l.tl;
    var a = l.hd;
    if (col === ymove) {
      _l = rest;
      _cnt = cnt + func2(a, pos) | 0;
      _pos = Caml_int32.mod_(pos + xmove | 0, a.length);
      _col = 1;
      continue ;
    }
    _l = rest;
    _col = col + 1 | 0;
    continue ;
  };
}

function func0(_cnt, _l) {
  while(true) {
    var l = _l;
    var cnt = _cnt;
    if (!l) {
      return cnt;
    }
    var a = l.hd;
    var ymove = a[1];
    _l = l.tl;
    _cnt = Math.imul(cnt, func1(a[0], ymove, ymove, 0, 0, data));
    continue ;
  };
}

